{% extends "betterbuysite/email/base.html" %}

{% block email-title %}Thanks for purchasing at better-buy-site{% endblock %}

{% block email-head %}
  {{ block.super }}
  <p>To proceed with your order, please transfer {{ order.total }} onto our bank account:</p>
  <pre>
better-buy-site
IBAN: DE1234567890
  </pre>
  <p>As payment reference, please use {{ order.number }}.</p>
{% endblock %}

{% block email-body %}
  {% include "shop/email/order-detail.html" %}
  {% include "shop/email/customer-information.html" %}
{% endblock %}

{% extends "betterbuysite/email/base.html" %}

{% block email-title %}Your order {{ order.number }} at better-buy-site has been shipped.{% endblock %}

{% block email-head %}
  {{ block.super }}
  {% if latest_delivery %}
    <p>Shipping method: {{ latest_delivery.shipping_method.label }}</p>
    <p>Shipping-ID: {{ latest_delivery.shipping_id }}</p>
  {% endif %}
{% endblock %}

{% block email-body %}
  {% include "shop/email/order-detail.html" %}
  {% include "shop/email/customer-information.html" %}
{% endblock %}
